import React, { useEffect , useState } from 'react'
import { Table , Button } from 'antd';
import { connect } from 'react-redux';
import { homDatas } from '@/actions/home'


export default connect(({ fromData }) => {
  return {
    datas: fromData.data
  }
}, {
  homDatas
})(Home)

function Home (props) {
  let { homDatas } =this.props
  useEffect (() => {
    homDatas()
  }, [])

  const columns = [
    {
      title: '姓名',
      dataIndex: 'name',
      key: 'name'
    },
    {
      title: '年龄',
      dataIndex: 'age',
      key: 'age',
    },
    {
      title: '地址',
      dataIndex: 'address',
      key: 'address',
    },
    {
      title: 'Action',
      key: 'action',
      render: (text, record) => (
        <span>
          <Button>添加</Button>
          <Button>编辑</Button>
          <Button>删除</Button>
        </span>
      ),
    },
  ];
  return (
    <div className="tables"> 
    {
      datas.length ?
      <Table rowKey="id" columns={columns} dataSource={this.props.datas} />
      :null
    }

    </div>
  )

}
